import { createChatBotMessage } from "react-chatbot-kit";

const Config = {
    botName: "Settle Guider",
    initialMessages: [createChatBotMessage(`Hi, I'm here to help. What are you looking for?`)],
    customStyles: {
        botMessageBox: {
          backgroundColor: "#376B7E",
        },
        chatButton: {
          backgroundColor: "#376B7E",
        },
      },
}

export default Config;
